import { useTranslation } from "react-i18next";
import "./footer.sass";

const Footer = () => {
    const { t, i18n } = useTranslation();
    return(
        <footer>
            <div className="wrap">
                <div className="footer">
                    <div className="footer__item">
                        <div className="logo"></div>
                    </div>
                    <div className="footer__item"></div>
                    <div className="footer__item"></div>
                    <div className="footer__item"></div>
                </div>
            </div>
        </footer>
    )
}
export default Footer;
